import React from 'react';
import logo from "../assets/logo.jpg"
const App = () => {

  return (
    <nav className='navbar'>
      <ul>
        <imag src={logo} alt ="logo"/>
      </ul>
      <ul>
        <li>Home</li>
        <li>About</li>
        <li>Contact</li>
      </ul>
      <ul>
        <li className='button'>Contact</li>
      </ul>
    </nav>
  );
};

export default App;
